import React from "react";
import "./home.css";

const Testimonials = () => {
  return (
    <div className="testimonials">
      <div className="container text-center">
        <br />
        <h2 className="heading"> TESTIMONIALS </h2>
        
      </div>
    </div>
  );
};

export default Testimonials;
